      SELECT col2 FROM tab1 (FORMAT parquet) WHERE NOT ( - - 24 ) * - 27 * - - 66 + + col0 IN ( + col2, col2 + - 56 - + col1 * - ( col0 ) );
  - name: tab1

outputs:
